Document okDoc = Jsoup.parse(ok);
assertTrue(cleaner.isValid(okDoc));
assertFalse(cleaner.isValid(Jsoup.parse(nok)));
assertFalse(new Cleaner(Whitelist.none()).isValid(okDoc));

